import Remote from "./Remote";


function App() {

  const onButtonClick = (val) => {
    const url = '/api/keypress';
    const requestOptions = {
      method: 'post',
      headers: {
        'Accept': 'application/json',
        'Content-Type': 'application/json'
      },
      body: JSON.stringify({ key: val })
    };
    fetch(url, requestOptions)
  }

  return (
    <Remote />
  );
}

export default App;
